import React from 'react';

function Color(props) {
  const colorType = props.colorType;
  const hex = props.colorNames.hex.toString();
  var colorName = "";

  return (
    <>
    <div className="color-item">
    <div className="color-chip" style={{backgroundColor:hex}}
    onClick={props.function}>
    </div>
    { (() => {
      switch(colorType) {
        case "HEX":
        alert(hex);
          colorName = hex;
          return ( <p className="color-name">{colorName}</p> );
        case "RGB":
        colorName = props.colorNames.rgb.r
        + " " + props.colorNames.rgb.g
        + " " + props.colorNames.rgb.b;
        return ( <p className="color-name">{colorName}</p> );
      }
    })
    }
    </div>
    </>
  )
}
  export { Color };
